export default class extends React.Component {
  render() {
    return (
      <div>
        <h1>¡Hola mundo!</h1>
        <p>Bienvenidos al curso de Next JS</p>

        <img src="/static/platzi.png" alt="Platzi" />

        <style jsx>
          {`
            h1 {
              color: red;
            }
            :global(p) {
              color: green;
            }
            body {
              background: yellow;
            }
          `}
        </style>

        <style jsx global>
          {`
              body {
                 background: yellow;
              }
            `}
        </style>

      </div>
    )
  }
}
